import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import * as Yup from 'yup';
import 'react-datepicker/dist/react-datepicker.css';
import './Produto.css';

function CadastroProduto() {
  const [nome, setNome] = useState('');
  const [descricao, setDescricao] = useState('');
  const [preco, setPreco] = useState(0);
  const [categoriaId, setCategoriaId] = useState(0);
  const [errors, setErrors] = useState({});
  const [successMessage, setSuccessMessage] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  const navigate = useNavigate();

  const handleVoltar = () => {
    navigate('/home'); // Redireciona para a página inicial
  };

  const schema = Yup.object().shape({
    nome: Yup.string().required('O nome do produto é obrigatório'),
    descricao: Yup.string().required('A descrição do produto é obrigatória'),
    preco: Yup.number().required('O preço do produto é obrigatório'),
    categoriaId: Yup.number().required('A categoria do produto é obrigatória'),
  });

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      await schema.validate(
        { nome, descricao, preco, categoriaId },
        { abortEarly: false }
      );

      const response = await axios.post('http://localhost:4003/produto', {
        nome,
        descricao,
        preco,
        categoriaId,
      });

      console.log(response.data);
      setSuccessMessage('Produto criado com sucesso!');
      setErrorMessage('');

      setNome('');
      setDescricao('');
      setPreco(0);
      setCategoriaId(0);

      setErrors({}); // Limpar os erros
    } catch (error) {
      if (error instanceof Yup.ValidationError) {
        const validationErrors = {};
        error.inner.forEach((e) => {
          validationErrors[e.path] = e.message;
        });
        setErrors(validationErrors);
      } else {
        console.error(error);
        setErrorMessage(
          'Ocorreu um erro ao criar o produto. Por favor, tente novamente.'
        );
        setSuccessMessage('');
      }
    }
  };

  return (
    <div className='CreateProduto'>
      <h2>Criar Produto</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nome:</label>
          <input
            type='text'
            value={nome}
            onChange={(e) => setNome(e.target.value)}
          />
          {errors.nome && <span className='input-error'>{errors.nome}</span>}
        </div>
        <div>
          <label>Descrição:</label>
          <input
            type='text'
            value={descricao}
            onChange={(e) => setDescricao(e.target.value)}
          />
          {errors.descricao && (
            <span className='input-error'>{errors.descricao}</span>
          )}
        </div>
        <div>
          <label>Preço:</label>
          <input
            type='number'
            value={preco}
            onChange={(e) => setPreco(parseFloat(e.target.value))}
          />
          {errors.preco && <span className='input-error'>{errors.preco}</span>}
        </div>
        <div>
          <label>Categoria:</label>
          <input
            type='number'
            value={categoriaId}
            onChange={(e) => setCategoriaId(parseInt(e.target.value))}
          />
          {errors.categoriaId && (
            <span className='input-error'>{errors.categoriaId}</span>
          )}
        </div>
        {successMessage && (
          <div className='success-message'>{successMessage}</div>
        )}
        {errorMessage && <div className='error-message'>{errorMessage}</div>}
        <button type='submit'>Criar</button>
        <br></br>
        <button type='button' onClick={handleVoltar}>
          Voltar
        </button>
      </form>
    </div>
  );
}

export default  CadastroProduto;
